syntax = "proto3";

option java_multiple_files = true;
option java_package = "proposal";
option java_outer_classname = "Proposal";
option objc_class_prefix = "HLW";

package proposal;

message ProposalParentPojo {
  ProposalChildPojo proposalChildPojo = 1;
  repeated ProposalChildPojo proposalChildPojos = 2;
}

message ProposalChildPojo {
  string ProposalValue = 1;
}
